def reverse_complement(seq):
    listSeq = list(seq)
    listSeq.reverse()
    output = ''
    for base in listSeq:
        if base == "A":
            output += "T"
        if base == "T":
            output += "A"
        if base == "C":
            output += "G"
        if base == "G":
            output += "C"
    return output

